import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';

@Component({
  selector: 'app-view-inventoryitems',
  templateUrl: './view-inventoryitems.component.html',
  styleUrls: ['./view-inventoryitems.component.css']
})
export class ViewInventoryitemsComponent {

  inventory_TypeId!: number;

  constructor(private route: ActivatedRoute) { }

  ngOnInit(): void {
    this.route.params.subscribe(params => {
      this.inventory_TypeId = +params['inventory_TypeId'];
      // Fetch inventory items based on typeId using the InventoryService
    });
  }
}
